INSERT INTO `event_planner_promotions` (`id`, `country_id`, `event_detail`, `image`, `document`, `price_master_id`, `price`, `visible_date`, `like_count`, `user_id`, `created_on`, `edited_by`, `edited_on`, `is_deleted`) VALUES
(2, 1, 'Of sun, sand and mouth-watering Thai cuisine, Pattaya is a must-visit if Thailand''s on your bucket list. On this day, you will take a flight from your departure city, arrive in Bangkok and get a transfer to your hotel in Pattaya. Once you have checked-in, spend the day at leisure. Later, return to your hotel for a comfortable stay.\n\n\nSuggested: Once you have relaxed after your journey, you can head out to one of the finest and cleanest beaches in Pattaya - Wong Amat Beach. A peaceful beach to sun bathe, swim and relax. The beach isn''t crowded and you can hire chairs or try a variety of cuisines and drinks at the nearby restaurants and bars. Alternatively, you can visit the Walking Street and experience Pattaya''s famous nightlife! (Please note, that these are only suggested activities and are not included in the package.)', 'images/eventPlannerPromotion/3/Event_1039207889/image/3.png', '', 3, '1000.00', '2018-06-01', 0, 3, '2018-02-22 03:02:14', 0, '2018-02-28 10:39:30', 1),
(7, 1, '"test"', 'images/eventPlannerPromotion/1/Event_1411118136/image/1.jpg', '', 1, '0.00', '1970-01-01', 0, 1, '2018-02-22 03:21:44', 0, '2018-02-22 05:59:48', 1),
