INSERT INTO `membership` (`id`, `membership_name`, `description`, `price`, `duration`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Travel Agent', '<ul>\n<li>You can Place Requests or Respond to Requests for Travel Packages, Hotel Rooms, or Transportation</li>\n<li>You will be able to communicate directly with other Travel Agents, Hoteliers, and Event Planners during negotiations</li>\n<li>There will be NO DEDUCTION from the 100 Requests until another User Responds to a Request</li>\n<li>There is NO LIMIT on the number of times a Travel Agent can Respond to Requests from other users</li>\n<li>You may renew your membership if the quota of 100 Requests is used</li>\n</ul>', '500 per 100 Requests', ' 1 Year', '1', '2017-05-02 12:50:23', '2017-08-21 10:43:52'),
(2, 'Event Planner', '<ul>\n<li>You can Place Requests for Travel Packages, Hotel Rooms, or Transportation</li>\n<li>You will be able to communicate directly with Travel Agents, and Hoteliers during negotiations</li>\n<li>There will be NO DEDUCTION from the 100 Requests until another User Responds to a Request</li>\n<li>You may renew your membership if the quota of 100 Requests is used</li>\n</ul>', '500 per 100 Requests', '1 year', '1', '2017-05-05 07:20:19', '2017-08-21 10:43:29'),
(3, 'Hotelier', '<ul>\r\n<li>You can Respond to Requests for Hotel Rooms</li>\r\n<li>You will be able to communicate directly with Travel Agents, and Event Planners during negotiations</li>\r\n<li>There is NO CHARGE OR LIMIT on the number of times a Hotelier can Respond to Requests from other users</li>\r\n</ul>', '500 per year', '1 year', '1', '2017-05-05 07:20:53', '2017-09-04 06:57:02');
