(1, 'First Post', 2, 3, '2018-09-09', 1, '1000.00', 1, 'Of sun, sand and mouth-watering Thai cuisine, Pattaya is a must-visit if Thailand''s on your bucket list. On this day, you will take a flight from your departure city, arrive in Bangkok and get a transfer to your hotel in Pattaya. Once you have checked-in, spend the day at leisure. Later, return to your hotel for a comfortable stay.\n\n\nSuggested: Once you have relaxed after your journey, you can head out to one of the finest and cleanest beaches in Pattaya - Wong Amat Beach. A peaceful beach to sun bathe, swim and relax. The beach isn''t crowded and you can hire chairs or try a variety of cuisines and drinks at the nearby restaurants and bars. Alternatively, you can visit the Walking Street and experience Pattaya''s famous nightlife! (Please note, that these are only suggested activities and are not included in the package.)', 'On this day, you can visit the suggested places or spend the day at leisure. Later, return to your hotel for a comfortable stay.\n\n\nSuggested: If you wish to visit all the major attractions in the world without leaving Pattaya, then you can visit Mini Siam and Mini Europe. A park attraction featuring miniature replicas of famous structures from Thailand and all over the world. In the afternoon you can take a walk in the Royal Garden Plaza or visit the Sanctuary of Truth - a wooden building filed with sculptures based on Hinduism and Buddhism. If you are an adventure enthusiast, you can spend your day at Jomtein Beach and indulge in jet skiing, parasailing, scuba diving, surfing and more. (Please note, that these are only suggested activities and are not included in the package.)', '', '', 1, '1500.00', 0, '2018-04-01', 3, '2018-02-18 06:42:31', 0, '2018-02-22 10:05:24', 1),
