INSERT INTO `taxi_fleet_promotions` (`id`, `title`, `country_id`, `fleet_detail`, `image`, `document`, `price_master_id`, `price`, `like_count`, `visible_date`, `user_id`, `created_on`, `edited_by`, `edited_on`, `is_deleted`) VALUES
(1, 'First Post', 1, 'Of sun, sand and mouth-watering Thai cuisine, Pattaya is a must-visit if Thailand''s on your bucket list. On this day, you will take a flight from your departure city, arrive in Bangkok and get a transfer to your hotel in Pattaya. Once you have checked-in, spend the day at leisure. Later, return to your hotel for a comfortable stay.\n\n\nSuggested: Once you have relaxed after your journey, you can head out to one of the finest and cleanest beaches in Pattaya - Wong Amat Beach. A peaceful beach to sun bathe, swim and relax. The beach isn''t crowded and you can hire chairs or try a variety of cuisines and drinks at the nearby restaurants and bars. Alternatively, you can visit the Walking Street and experience Pattaya''s famous nightlife! (Please note, that these are only suggested activities and are not included in the package.)', 'images/taxiFleetPromotion/3/image/3.jpg', 'images/taxiFleetPromotion/3/document/3.jpg', 2, '100.00', 0, '2018-05-01', 3, '2018-02-18 09:36:34', 0, '0000-00-00 00:00:00', 0),
